import React from "react";
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";


function Home() {
  return (
    <div>
      <h1>Home</h1>
    </div>
  );
}

const About = () => {<div>
  <h1>About</h1>
</div>}


function App() {
  return (
    <div>
      <h1> test </h1>
      <Router>
        <Switch>
          <Route path="/about" component={About} />
        </Switch>
      </Router>
    </div>
    
  );
}

export default App;
